import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { divide } from '../../../Unit-testing/02-intro/intro';

const elem = (
  <div>
    <h2>Hello world</h2>
    <input type='text' />
    <button></button>
  </div>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
);
